import Flexbox from 'flexbox-react';
import './Prodotti.css';

const Prodotti = () => {
// ...
<Flexbox flexDirection="column" minHeight="100vh">
  <Flexbox element="header" height="60px">
    Header
  </Flexbox>

  <Flexbox flexGrow={1}>
    Content
  </Flexbox>
</Flexbox>
}

export default Prodotti
